(function(){var loadHandler=window['sl_{0D0F1896-A3A1-4F38-9230-8F992AD62596}'];loadHandler&&loadHandler(37, '<div id="spr0_22605a"><div id="spr1_22605a" class="kern slide"><img id="img5_22605a" src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA8AAAAIcAQMAAAADk1U4AAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAADUExURQAAAKd6PdoAAAAJcEhZcwAACxIAAAsSAdLdfvwAAABWSURBVHja7cExAQAAAMKg9U9tCF8gAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAATjX/PAAB8FDVdQAAAABJRU5ErkJggg==" width="960px" height="540px" alt="" style="left:0px;top:0px;"/><div id="spr3_22605a" style="left:5px;top:523px;"><div style="width:0px;"><span id="txt0_22605a" class="nokern" data-width="100.751953" style="top:-1.265px;">Classified as Confidential</span></div></div></div><div id="spr2_22605a" class="kern slide"><div id="spr4_22605a" style="left:11.732px;top:-2.236px;"><img id="img0_22605a" src="data:image/png;base64," width="108.776" height="101.732" alt="" style="left:-1.007px;top:-1.007px;"/></div><div id="spr5_22605a" style="left:55px;top:29px;"><img id="img1_22605a" src="data:image/png;base64," width="308" height="37" alt="Von Neuman Architecture"/></div><div id="spr6_22605a" style="left:664.768px;top:39.935px;"><img id="img2_22605a" src="data:image/png;base64," width="287.318" height="144.741" alt=""/></div><div id="spr7_22605a" style="left:815px;top:60px;"><img id="img3_22605a" src="data:image/png;base64," width="99" height="99" alt=""/></div><div id="svg12_22605a" style="left:816.978px;top:83.613px;"><svg width="94" height="1" viewBox="0 0 94 1"><g fill="#33cccc" fill-opacity="0.44" stroke="none"><path transform="translate(0,0.25)" d="M0,-0.25 h93.6 v0.5 h-93.6 Z"/></g></svg></div><div id="svg14_22605a" style="left:816.978px;top:100.324px;"><svg width="94" height="1" viewBox="0 0 94 1"><g fill="#33cccc" fill-opacity="0.44" stroke="none"><path transform="translate(0,0.25)" d="M0,-0.25 h93.6 v0.5 h-93.6 Z"/></g></svg></div><div id="svg16_22605a" style="left:816.978px;top:117.513px;"><svg width="94" height="1" viewBox="0 0 94 1"><g fill="#33cccc" fill-opacity="0.44" stroke="none"><path transform="translate(0,0.25)" d="M0,-0.25 h93.6 v0.5 h-93.6 Z"/></g></svg></div><div id="svg18_22605a" style="left:816.135px;top:134.013px;"><svg width="94" height="1" viewBox="0 0 94 1"><g fill="#33cccc" fill-opacity="0.44" stroke="none"><path transform="translate(0,0.25)" d="M0,-0.25 h93.6 v0.5 h-93.6 Z"/></g></svg></div><div id="svg20_22605a" style="left:816.135px;top:146.613px;"><svg width="94" height="1" viewBox="0 0 94 1"><g fill="#33cccc" fill-opacity="0.44" stroke="none"><path transform="translate(0,0.25)" d="M0,-0.25 h93.6 v0.5 h-93.6 Z"/></g></svg></div><div id="svg22_22605a" style="left:818.283px;top:71.613px;"><svg width="94" height="1" viewBox="0 0 94 1"><g fill="#33cccc" fill-opacity="0.44" stroke="none"><path transform="translate(0,0.25)" d="M0,-0.25 h93.6 v0.5 h-93.6 Z"/></g></svg></div><div id="svg24_22605a" style="left:25.62px;top:92.903px;"><svg width="100" height="40" viewBox="-4.572 -4.572 100 40"><path fill="none" stroke="#808080" stroke-width="0.8" stroke-linecap="butt" stroke-linejoin="miter" stroke-miterlimit="8" d="M0.125,4.322 a4.197,4.197 0 0,1 4.197,-4.197 h81.904 a4.197,4.197 0 0,1 4.197,4.197 v21.571 a4.197,4.197 0 0,1 -4.197,4.197 h-81.904 a4.197,4.197 0 0,1 -4.197,-4.197 Z" fill-rule="evenodd"/></svg></div><div id="spr8_22605a" style="left:30.193px;top:97.476px;"><div style="width:0px;"><span id="txt1_22605a" data-width="67.631836" style="left:8.554px;top:2.677px;">Scenario:</span></div></div><div id="spr9_22605a" style="left:-0.5px;top:104.209px;"><img id="img4_22605a" src="data:image/png;base64," width="28" height="21" alt="" style="left:-0.597px;top:-0.761px;"/></div><div id="spr10_22605a" style="left:122.389px;top:92.575px;"><div style="width:0px;"><span id="txt2_22605a" data-width="495.414062" style="left:7.2px;top:4.452px;">Suppose you opened a calculator app and then you pressed 5 on the keyboard</span></div><div style="width:0px;"><span id="txt3_22605a" data-width="484.328125" style="left:7.2px;top:23.652px;">then let’s see what will happen focusing on the I/O Module interaction only</span></div><div style="width:0px;"><span id="txt4_22605a" data-width="310.601562" style="left:7.2px;top:42.852px;">without getting into the other details in between:</span></div></div><div id="spr11_22605a" style="top:185.385px;"><div style="width:0px;"><span id="txt5_22605a" data-width="880.640625" style="left:7.2px;top:1.576px;">- You pressed 5 on the keyboard, then you need to know that each keypress on the keyboard generates a specific signal that dictates its</span></div><div style="width:0px;"><span id="txt6_22605a" data-width="793.437500" style="left:7.2px;top:20.776px;">corresponding interpretation whether a character or number or doing a special operation like volume up or start key…etc.</span></div></div><div id="spr12_22605a" style="top:231.347px;"><div style="width:0px;"><span id="txt7_22605a" data-width="875.929688" style="left:7.2px;top:1.576px;">- That signal will be sent to the Keyboard controller that is considered to be part of the I/O Module and is responsible of converting the</span></div><div style="width:0px;"><span id="txt8_22605a" data-width="196.195312" style="left:7.2px;top:20.776px;">keypress signal into a keycode</span></div></div><div id="spr13_22605a" style="left:-0px;top:283.984px;"><div style="width:0px;"><span id="txt9_22605a" data-width="797.664062" style="left:7.2px;top:1.576px;">- Keyboard driver that runs in the background will be responsible of converting that keycode of 5 into ASCI code 0011 0101</span></div></div><div id="spr14_22605a" style="left:-0.107px;top:309.168px;"><div style="width:0px;"><span id="txt10_22605a" data-width="368.984375" style="left:7.2px;top:1.576px;">- The Data will be moved to the Buffer of the I/O Module</span></div></div><div id="spr15_22605a" style="top:387.123px;"><div style="width:0px;"><span id="txt11_22605a" data-width="862.187500" style="left:7.2px;top:1.576px;">- The CPU will move the data from the I/O Moule Buffer to its own I/O BR and store also the keyboard address or port address that is</span></div><div style="width:0px;"><span id="txt12_22605a" data-width="310.320312" style="left:7.2px;top:20.776px;">keyboard connected to it physically in its I/O AR</span></div></div><div id="spr16_22605a" style="left:-0.107px;top:336.719px;"><div style="width:0px;"><span id="txt13_22605a" data-width="912.125000" style="left:7.2px;top:1.576px;">- The I/O module will send an IRQ (Interrupt Request) to the CPU to notify it that there’s some data from the keyboard as input and needs to</span></div><div style="width:0px;"><span id="txt14_22605a" data-width="806.398438" style="left:7.2px;top:20.776px;">be processed. So, the CPU will interrupt its current task quickly and acknowledge that IRQ being received from the keyboard</span></div></div><div id="spr17_22605a" style="left:2.383px;top:438.643px;"><div style="width:0px;"><span id="txt15_22605a" data-width="876.437500" style="left:7.2px;top:1.576px;">- The CPU may decide to store in one of its general-purpose register (GR) so accessing it will be much faster if you will perform addition</span></div><div style="width:0px;"><span id="txt16_22605a" data-width="910.648438" style="left:7.2px;top:20.776px;">operation or something then you don’t have to access memory and write data temporarily in it and then retrieve it again to be processed by</span></div><div style="width:0px;"><span id="txt17_22605a" data-width="828.585938" style="left:7.2px;top:39.976px;">the ALU according to the arithmetic instruction operation and so on. So this organizational design perspective not architectural.</span></div></div></div></div>', '{"s":[]}');})();